import ReactDOM from "react-dom";
import React, { Fragment, useEffect } from "react";
import Card from "../UI/Card";

const Cart = (props) => {
  const cartitem = (
    <ul>
      {[{ id: "m1", name: "shushi", amount: 2, price: 13.13 }].map((item) => (
        <li>{item.name}</li>
      ))}
    </ul>
  );
  return;
  <div>
    {cartitem}
    <div></div>
    <div></div>
  </div>;
};

export default Cart;
